export default function ahc1() {
  return (
    <div >
      <h3 className="title">The surprising power of Atomic Habits</h3>
      <p>We all deal with setbacks but  in the long run the quality of our lives depends on the quality of our habits</p>
      <p>Being a little bit nicer in each interaction can lead to a network of strong and broad connections overtime</p>
    </div>
  )
}
